import React from "react";
import web from "./images/coderman_img.jpg";
import Common from "./Common";
export default function About() {
  return (
    <>
    <Common 
    name="Wecome to About Page"
    visite="/contact"
    btn="Contact Me"
    img={web}
    />
    </>
  );
}
